export default {
    strict: false,
    state: {
        // 应用的数据
        test: 'hello vuex',
        counters: [],
        counterSum: 0
    },
    mutations: {
        minusValue (state, index) {
            state.counters[index].value--;
            state.counterSum--;
        },
        plusValue (state, index) {
            state.counters[index].value++;
            state.counterSum++;
        }
    }
}
